SET FEEDBACK ON
SET SERVEROUTPUT ON
DEFINE TENANT_ID ='&1'
DECLARE
V_TENANT_ID NUMBER(38,0);
V_TID NUMBER(38,0) := '&TENANT_ID';
V_SCREENSHOT CLOB :=
 'data:image/png;base64,'||
