 '';
CURSOR TENANT_CURSOR IS
    SELECT DISTINCT TENANT_ID FROM EMS_DASHBOARD ORDER BY TENANT_ID;

BEGIN
OPEN TENANT_CURSOR;
  LOOP
     IF (V_TID<>-1) THEN
        V_TENANT_ID:=V_TID;
     ELSE
       FETCH TENANT_CURSOR INTO V_TENANT_ID;
       EXIT WHEN TENANT_CURSOR%NOTFOUND;
     END IF;
        UPDATE EMS_DASHBOARD SET SCREEN_SHOT = V_SCREENSHOT WHERE DASHBOARD_ID = 2 AND TENANT_ID = V_TENANT_ID;
        DBMS_OUTPUT.PUT_LINE(' Screenshot of  ITA OOB widget have been updated according to EMCPDF-2411.For '||V_TENANT_ID);
     IF (V_TID<>-1) THEN
        EXIT;
     END IF;
  END LOOP;
  CLOSE TENANT_CURSOR;
  commit;

EXCEPTION
WHEN OTHERS THEN
  ROLLBACK;
  DBMS_OUTPUT.PUT_LINE('Failed to update Screenshot of some TA OOB widget according to EMCPDF-2411 due to '||SQLERRM);
  RAISE;  
END;
